import Container from 'react-bootstrap/Container';

const MainFooter = () => (
  <footer>
    <div className='footer-wrapper'>
      <Container>
        <img src='/img/StatMix_Logo.png' alt='StatMix Logo' height='32px' />
      </Container>
    </div>
  </footer>
);

export default MainFooter;
